import React, { useState } from 'react';

const Compare = ({ note, onCompare }) => {
  const [formData, setFormData] = useState({ start: '', end: '' });

  const { start, end } = formData;

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleCompare = (formData) => {
    console.log('formData:', formData); // Add this line for debugging
    if (note && note.estart && typeof note.estart === 'string' && note.estart.includes(formData.start)) {
      console.log('Comparison successful.'); // Add this line for debugging
      onCompare(formData);
    } else {
      console.log('Comparison failed.'); // Add this line for debugging
      // Handle the case where note.estart is not defined or does not match formData.start
    }
  };


  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted.'); // Add this line for debugging
    handleCompare(formData);
  };

  return (
    <div>
      <h2>Enter Location</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="start" className="form-label">
            Starting Position
          </label>
          <input
            type="text"
            className="form-control"
            id="start"
            name="start"
            value={start}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-3">
          <label htmlFor="end" className="form-label">
            Destination Position
          </label>
          <input
            type="text"
            className="form-control"
            id="end"
            name="end"
            value={end}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit" className="btn btn-primary">
          Search
        </button>
      </form>
    </div>
  );
};

export default Compare;
